import React from "react"
import Grid from '@mui/material/Grid';
import Box from '@mui/material/Box';
import Fab from '@mui/material/Fab';
import AddIcon from '@mui/icons-material/Add';
import Paper from '@mui/material/Paper';
import EditIcon from '@mui/icons-material/Edit';
import classes from '../Login.module.css';
import Divider from '@mui/material/Divider';
const Tasks = (props) => {
    return (
        <React.Fragment>
            {/* <Box sx={{ '& > :not(style)': { m: 0.5 }, marginLeft: 150, height: 5 }} className={classes.toggleactionbutton}>
                <Fab color="primary" aria-label="add" size="small">
                    <AddIcon />
                </Fab>
                <Fab color="secondary" aria-label="edit" size="small">
                    <EditIcon />
                </Fab>
            </Box> */}

            <Grid sx={{ flexGrow: 1 }} container spacing={{ xs: 2, md: 3 }}  >
                <Grid item xs={12} sx={{ m: 1 }}>
                    <Grid container justifyContent="flex-end" alignItems='center' direction='row' spacing={3} >
                        <Fab color="primary" aria-label="add" size="small" sx={{ marginTop: 0 }}>
                            <AddIcon />
                        </Fab>
                        <Fab color="secondary" aria-label="edit" size="small">
                            <EditIcon />
                        </Fab>
                    </Grid>
                    <Divider />
                    <Grid item xs={12} sx={{ m: 1 }}></Grid>
                    <Grid container justifyContent="flex-start" alignItems='center' direction='row' spacing={3} >
                        {[1, 2, 3, 4, 5, 6].map((value) => (
                            <Grid key={value} item>
                                <Paper
                                    sx={{
                                        height: 420,
                                        width: 400,
                                        backgroundColor: (theme) =>
                                            theme.palette.mode === 'dark' ? '#1A2027' : '#fff',
                                    }}
                                />
                            </Grid>
                        ))}
                    </Grid>
                </Grid>
            </Grid>
        </React.Fragment>
    );
};
export default Tasks;
